    false,nt"url": null,nt"notes": "This data set represents the sediment profile
    imaging data from 2004 (79 stations).In Fall/Winter 2002, researchers from the Virginia
    Institute of Marine Science (VIMS) and the NOAA Office for Coastal Management conducted
    a project to map benthic habitats by Catlett and Goodwin Islands on the York River,
    Chesapeake Bay, Virginia. Sediment grab samples were collected at 56 stations and
    sediment profile images were collected at 200 stations. Sampling areas were also
    surveyed using side scan sonar and interferometric swath bathymetry sensors. Scientists
    from the Virginia Institute of Marine Sciences returned to sample a subset of the
    2002 sediment grab data in 2003 and then again in 2004. A subset of SPI stations
    (79) were revisited in 2004.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
